<!-- 「ランキング受賞速報」ここまで -->


<br>

DIABLOからシングルラインショルダーバッグの登場です。<br><br>
ダブルラインと斜めジッパーが個性を演出してくれるショルダーバッグです。<br><br>
表面にはmp3やiPod等、音楽プレーヤーのイヤホンをバッグに入れたまま
取り出せるよう設計されており、ビジュアル面でも機能面でも納得のクオリティー。<br><br>
様々なシーンにも対応出来るメンズショルダーバッグです。<br><br>
シンプルでありながらメタリックカラーで存在感を表すシングルラインが特徴です。<br><br>
メイン収納の開閉部分はマグネットになっており、開閉の際煩わしさを感じさせません。<br><br>
表面にはmp3やiPod等、音楽プレーヤーのイヤホンをバッグに入れたまま
取り出せるよう設計されており、ビジュアル面でも機能面でも納得のクオリティー。<br><br>
サイドのポケットには突然の雨に備えて折り畳み傘を収納できます。<br><br>
内側にはオープンポケットが二つ付いており、携帯電話や財布といったすぐに
取り出したいものを入れておくのに便利です。<br><br>
銀色に輝くファスナーの上にはDIABLOのロゴが型押しされており
オシャレなワンポイントとなっております。<br><br>
外見はスマートな印象ですがA４サイズのファイルや雑誌も収納することができます。<br><br>
手触りがよく高級感溢れる外生地に無駄のない洗練されたデザインを兼ね備えた
このショルダーバックは大人から子供まで年齢に関係なくお使いいただけます。<br><br>

◆本体サイズ◆<br>
約　W35cm×H25cm×D8cm<br><br>

◆素材◆<br>
ＰＵ（合皮）、ナイロン <br><br>

◆仕様◆<br>
外側部　ファスナーポケット×２、大ポケット×１　サイドポケット×２<br>
内側部　中ポケット×１、小ポケット×１<br><br>

◆付属品◆<br>
ショルダーストラップ　約　70～135cm<br><br>



