<br>
BLACKとGOLDを基調とした存在感のある新しいタイプのボストンバッグ。<br>
内面は耐久性の高い上質のコットンを採用。<br>
数センチずれると機能性が落ちるポケット類も、計算された技術で不快感を一切感じないよう工夫されたモデルとなっております。<br>
サイズ感はボストンというより、少し大きめのショルダーバッグと言ったところ。<br>
しかし、その収納力はまさにボストンバッグそのもの。<br>
そんなスタイルの良いボストンバッグ造りは不可能だという概念を打ち砕いたのがこの特徴であるドレープ感と多彩な収納スペースなのだ。<br>
クタッとしたドレープは荷物が少ない時はバッグをスリムに魅せる効果が絶大なうえにいざというときには大量の荷物を楽々収納できるデザインなのである。<br>
また、大きく幅をとった前面ZIPポケットと深く奥行きのある両サイドポケットは上手くバッグの高さを利用した設計となっており荷物を入れることで、前面・側面に鞄が膨張しようとする力を縦に逃がすようになっている。<br>
ただのデザインではなく、機能面や実用性を重視して必然的に生まれたこのフォルムこそこれからのショルダーボストンバッグの理想であり原点である。<br><br>
